const desks = {
    state: {
      desks: [
        {id:0, istaken:false, place:"bigRoom", price:10, location:"center", size:"medium"},
        {id:1, istaken:false, place:"bigRoom", price:10, location:"next to window", size:"medium"},
        {id:2, istaken:false, place:"bigRoom", price:10, location:"center", size:"medium"},
        {id:3, istaken:true, place:"bigRoom", price:10, location:"center", size:"medium"},
        {id:4, istaken:true, place:"bigRoom", price:10, location:"center", size:"medium"},
        {id:5, istaken:true, place:"bigRoom", price:10, location:"next to window", size:"medium"},
        {id:6, istaken:true, place:"smallRoom", price:10, location:"center", size:"medium"},
        {id:7, istaken:true, place:"smallRoom", price:10, location:"center", size:"medium"},
        {id:8, istaken:true, place:"smallRoom", price:10, location:"next to window", size:"medium"},
        {id:9, istaken:true, place:"smallRoom", price:10, location:"center", size:"medium"},
      ],
    },
    mutations: {},
    actions: {},
    getters: {},
  };
  
  export default desks;
